import React from "react";

function Jumbotron(){
    return(
        <div class="jumbotron jumbotron-fluid">
  <div class="container">
    <h1 class="display-4">In 2020 the US Government has spent</h1>
    <br></br>
    <h1 class="display-4">*insert live debt tracker</h1>
    <br></br>
    <h1 class="display-4">The People's Purse gives citizens the ability to voice their opinions on how their tax dollars are spent.</h1>
  </div>
</div>
    )
}

export default Jumbotron;
